import React, { useState } from 'react';
import { Form, Button, Card, Alert, Row, Col } from 'react-bootstrap';
import { jobAPI } from '../services/api';

const JobForm = ({ onJobCreated }) => {
  const [job, setJob] = useState({
    title: '', company: '', description: '', requirements: '', location: '', salary: '', postedBy: ''
  });
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      await jobAPI.create(job);
      setMessage('Job posted successfully! üéâ');
      setJob({ title: '', company: '', description: '', requirements: '', location: '', salary: '', postedBy: '' });
      onJobCreated?.();
    } catch (error) {
      setMessage('Error posting job ‚ùå');
    }
    setLoading(false);
  };

  return (
    <Card className="card-hover">
      <Card.Header className="bg-primary text-white">
        <h4 className="mb-0">üíº Post New Job</h4>
      </Card.Header>
      <Card.Body>
        {message && (
          <Alert variant={message.includes('Error') ? 'danger' : 'success'} className="mb-3">
            {message}
          </Alert>
        )}
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col md={6}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Job Title</Form.Label>
                <Form.Control 
                  value={job.title} 
                  onChange={(e) => setJob({...job, title: e.target.value})} 
                  placeholder="e.g. Full Stack Developer"
                  required 
                />
              </Form.Group>
            </Col>
            <Col md={6}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Company</Form.Label>
                <Form.Control 
                  value={job.company} 
                  onChange={(e) => setJob({...job, company: e.target.value})} 
                  placeholder="e.g. Tech Corp"
                  required 
                />
              </Form.Group>
            </Col>
          </Row>

          <Form.Group className="mb-3">
            <Form.Label className="fw-bold">Job Description</Form.Label>
            <Form.Control 
              as="textarea" 
              rows={3} 
              value={job.description} 
              onChange={(e) => setJob({...job, description: e.target.value})} 
              placeholder="Describe the role and responsibilities..."
              required 
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label className="fw-bold">Requirements & Skills</Form.Label>
            <Form.Control 
              as="textarea" 
              rows={3} 
              value={job.requirements} 
              onChange={(e) => setJob({...job, requirements: e.target.value})} 
              placeholder="List required skills, experience, qualifications..."
              required 
            />
          </Form.Group>

          <Row>
            <Col md={4}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Location</Form.Label>
                <Form.Control 
                  value={job.location} 
                  onChange={(e) => setJob({...job, location: e.target.value})} 
                  placeholder="Remote / City, State"
                  required 
                />
              </Form.Group>
            </Col>
            <Col md={4}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Salary Range</Form.Label>
                <Form.Control 
                  value={job.salary} 
                  onChange={(e) => setJob({...job, salary: e.target.value})} 
                  placeholder="$80,000 - $120,000"
                />
              </Form.Group>
            </Col>
            <Col md={4}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Posted By</Form.Label>
                <Form.Control 
                  value={job.postedBy} 
                  onChange={(e) => setJob({...job, postedBy: e.target.value})} 
                  placeholder="Your Name, Title"
                  required 
                />
              </Form.Group>
            </Col>
          </Row>

          <Button type="submit" className="btn-gradient w-100" disabled={loading}>
            {loading ? 'üîÑ Posting...' : 'üöÄ Post Job'}
          </Button>
        </Form>
      </Card.Body>
    </Card>
  );
};

export default JobForm;
